import React from "react";
import Header from "./components/Layout/Header";
import Footer from "./components/Layout/Footer";

const Layout = ({ children }) => {
  return (
    <>
      <Header />
      <main style={{ padding: "16px" }}>{children}</main>
      <Footer />
    </>
  );
};

export default Layout;
